import React from "react";
import {Header} from '../components/Header/Header.jsx';
import DashboardBox from "../components/Dashboard/DashboardBox.jsx";
import Photo from "../components/Assets/smkn3mks.png";
import '../styles/Dashboard.css'
import Teacher from '../components/Assets/teacher.png';
import Student from '../components/Assets/student.png';
import Headmaster from '../components/Assets/headmaster.png';

export const Dashboard = () => {
    return(
    <body>
    <div class="dashboard-wrapper">
    <Header/>
    </div>
    <img className="school-pict"src={Photo}/>
    <div className="content-wrapper">
    <tr>
        <th><DashboardBox className="box-menu" Text="Data Guru" src={Teacher} imageSize="80px"/></th>
        <th><DashboardBox className="box-menu" Text="Data Siswa" src={Student} imageSize="80px"/></th>
        <th><DashboardBox className="box-menu" Text="Data Kepala Sekolah " src={Teacher} imageSize="80px"/></th>
    </tr>
    <tr>
        <th><DashboardBox className="box-menu" Text="Data Wakasek Kurikulum" src={Teacher} imageSize="80px"/></th>
        <th><DashboardBox className="box-menu" Text="Rekapitulasi Absen" src={Teacher} imageSize="80px"/></th>
    </tr>
    </div>
    </body>
   
);


}

export default Dashboard;
